import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Contact from './contact';
import Home from './home'
import Navbar from './navbar'

function App() {

  return (
   <Router>
    <Navbar />
    <Routes>
    <Route path='/' exact element={Home} />
    </Routes>
   </Router>
  );
};

export default App;
